export const PAGES = [
  { name: "top", title: "top", url: "/" },
  { name: "page2", title: "page2", url: "/page2" },
  { name: "good", title: "good", url: "/good" },
  { name: "test", title: "test", url: "/test" },
];

export const columns = [
  { Header: "商品", accessor: "product" },
  { Header: "値段", accessor: "price" },
  { Header: "在庫", accessor: "stock" },
];

export const data = [
  {
    product: "りんご",
    price: "120円",
    stock: "130",
  },
  {
    product: "バナナ",
    price: "100円",
    stock: "200",
  },
  {
    product: "メロン",
    price: "3400円",
    stock: "2",
  },
];

//サンプル↓(使ってない)
export const PAGE_NAME = {
  TOP: "top",
  PAGE2: "page2",
  GOOD: "good",
  TEST: "test",
};

export const PAGE_URL_ARRAY = ["/page2", "good", "test"];
